export default class Footer extends Component {
    render() {
        return(

        <footer className="footer">
            <Grid>
<h2>De footer</h2>

                <hr/>
                <Col xs={12} sm={12} className="footer">
                <span className="text-footer">&copy; Mellowwebdesign  {new Date().getFullYear()} - </span> <Link to="/algemenevoorwaarde">Algemene voorwaarde </Link>
                    <Link to="/algemenevoorwaarde">Cookie Policy  </Link>
                    <Link to="/algemenevoorwaarde">Pivacy Policy </Link>
                </Col>
            </Grid>

        </footer>
        )
    }
}
